CREATE OR REPLACE TRIGGER "EIS"."TPEGAWAI_ALIH_STATUS" AFTER INSERT OR UPDATE OF "STATUS" ON "EIS"."PEGAWAI" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
DECLARE
  staff_ number(5);
  jumlah_status number(1);
  nmr_pegawai number(10); 
BEGIN
  IF :new.status=1 and :new.staff<>8 and :new.staff<>99 THEN    
      select count(nomor) into jumlah_status from absensikaryawan_status  
     where pegawai=:new.nomor and tanggal=sysdate;    
    
    
    if jumlah_status=0 then          
        select nabsensikar_status.nextval,:new.nomor,tanggal,case libur when 1 then 'L'
         else 'A' end  from tanggal
          where tanggal not in 
            (select tanggal from absensikaryawan_status where pegawai=:new.nomor)
              and tanggal>=to_date(sysdate,'dd-mm-yyyy');              
    
    if :old.staff=5 then
      pabsensikaryawan_satpam(:new.nomor,sysdate);
    end if; 
    end if;   
  END IF;
END;
